exports=async function(url,bid,cid,options){const{parseContent,trimBeforeContent}=await require("transcode/parse_content");return parseContent(url,"div#content",{clientOptions:{...(options&&options.clientOptions)}}).then(_=>{if(4<_.length)for(let i=_.length-1;0<i;i--)if(!/请大家收藏新地址|请下载.+最新(?:内容|章节)|为你提供.+更新.+\w+\.\w+/.test(_[i])){i<_.length-1&&_.splice(i+1,_.length-i-1);break}return _})};